import React from "react";
import { Video, AlertTriangle, ArrowUp, ArrowDown, ArrowLeft, ArrowRight, Square } from "lucide-react";

const ControlPanel = ({
  videoStream,
  isVideoConnected,
  videoUrl,
  isConnected,
  handleMouseDown,
  handleMouseUp,
  handleTouchStart,
  handleTouchEnd,
  handleStopClick,
}) => {
  return (
    <div className="flex flex-col md:flex-row gap-6 p-6 bg-gray-50 rounded-2xl shadow-lg max-w-6xl mx-auto">
      {/* Video Section */}
      <div className="flex-1 bg-white rounded-xl shadow p-4 flex flex-col items-center justify-center">
        {videoStream && isVideoConnected ? (
          <img
            src={videoStream}
            alt="Live Video Feed"
            className="w-full h-80 object-cover rounded-lg border border-gray-200"
          />
        ) : (
          <div className="flex flex-col items-center justify-center h-80 text-center text-gray-600">
            <Video size={48} className="text-gray-400 mb-3" />
            <p className="font-medium">
              {isVideoConnected
                ? "Connecting to video stream..."
                : "Live video feed will appear here"}
            </p>
            <small className="text-gray-500 mt-1">
              {videoUrl
                ? `Stream URL: ${videoUrl}`
                : "Configure video stream URL in settings"}
            </small>
            {!isVideoConnected && videoUrl && (
              <div className="mt-4 flex items-center gap-2 text-sm text-red-500 font-medium">
                <div className="w-2 h-2 rounded-full bg-red-500 animate-pulse"></div>
                Video stream disconnected
              </div>
            )}
          </div>
        )}
      </div>

      {/* Controller Section */}
      <div className="w-full md:w-1/3 bg-white rounded-xl shadow p-6 flex flex-col items-center justify-center">
        <h2 className="text-xl font-semibold mb-4 text-gray-800">Vehicle Controls</h2>

        <div className="grid grid-cols-3 gap-3">
          <div></div>
          <button
            id="forward"
            onMouseDown={() => handleMouseDown("forward")}
            onMouseUp={() => handleMouseUp("forward")}
            onTouchStart={(e) => handleTouchStart(e, "forward")}
            onTouchEnd={(e) => handleTouchEnd(e, "forward")}
            disabled={!isConnected}
            className={`control-btn ${!isConnected && "opacity-50 cursor-not-allowed"}`}
          >
            <ArrowUp className="w-5 h-5" />
          </button>
          <div></div>

          <button
            id="left"
            onMouseDown={() => handleMouseDown("left")}
            onMouseUp={() => handleMouseUp("left")}
            onTouchStart={(e) => handleTouchStart(e, "left")}
            onTouchEnd={(e) => handleTouchEnd(e, "left")}
            disabled={!isConnected}
            className={`control-btn ${!isConnected && "opacity-50 cursor-not-allowed"}`}
          >
            <ArrowLeft className="w-5 h-5" />
          </button>

          <button
            id="stop"
            onClick={handleStopClick}
            disabled={!isConnected}
            className={`control-btn bg-red-500 hover:bg-red-600 ${!isConnected && "opacity-50 cursor-not-allowed"}`}
          >
            <Square className="w-5 h-5" />
          </button>

          <button
            id="right"
            onMouseDown={() => handleMouseDown("right")}
            onMouseUp={() => handleMouseUp("right")}
            onTouchStart={(e) => handleTouchStart(e, "right")}
            onTouchEnd={(e) => handleTouchEnd(e, "right")}
            disabled={!isConnected}
            className={`control-btn ${!isConnected && "opacity-50 cursor-not-allowed"}`}
          >
            <ArrowRight className="w-5 h-5" />
          </button>

          <div></div>
          <button
            id="backward"
            onMouseDown={() => handleMouseDown("backward")}
            onMouseUp={() => handleMouseUp("backward")}
            onTouchStart={(e) => handleTouchStart(e, "backward")}
            onTouchEnd={(e) => handleTouchEnd(e, "backward")}
            disabled={!isConnected}
            className={`control-btn ${!isConnected && "opacity-50 cursor-not-allowed"}`}
          >
            <ArrowDown className="w-5 h-5" />
          </button>
          <div></div>
        </div>

        {!isConnected && (
          <div className="mt-4 flex items-center gap-2 text-sm text-yellow-600 font-medium">
            <AlertTriangle size={16} />
            Vehicle not connected
          </div>
        )}
      </div>
    </div>
  );
};

export default ControlPanel;
